import React from 'react';
import styled from 'styled-components';

const TableContainer = styled.div`
  margin: 20px 0;
`;

const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
  background-color: #333;
  color: #fff;
`;

const TableHeader = styled.th`
  padding: 10px;
  border-bottom: 2px solid #444;
`;

const TableData = styled.td`
  padding: 10px;
  border-bottom: 1px solid #444;
`;

const OrdersTable = ({ orders, handleDelete }) => {
  return (
    <TableContainer>
      <Table>
        <thead>
          <tr>
            <TableHeader>ID</TableHeader>
            <TableHeader>Cliente</TableHeader>
            <TableHeader>Total</TableHeader>
            <TableHeader>Pagado</TableHeader>
            <TableHeader>Acciones</TableHeader>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order.idOrden}>
              <TableData>{order.idOrden}</TableData>
              <TableData>{order.cliente}</TableData>
              <TableData>{order.total}</TableData>
              <TableData>{order.pagado}</TableData>
              <TableData>
                <button onClick={() => handleDelete(order.id)}>Eliminar</button>
              </TableData>
            </tr>
          ))}
        </tbody>
      </Table>
    </TableContainer>
  );
};

export default OrdersTable;
